import * as React from 'react';
import { experimentalStyled as styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { CardActionArea } from '@mui/material';
import { useDispatch, useSelector } from 'react-redux';
import Typography from '@mui/material/Typography';
import { getQuestions } from '../hooks/Axios';
import { questionAnswers } from '../Redux/action';
import { useHistory } from 'react-router-dom/cjs/react-router-dom.min';
const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

export default function Admin() {
    const history = useHistory();
const dispatch = useDispatch()
   const viewAnswers = async (data)=>{
    viewQuestion()

   }


    const [userdatas, setUserDatas] = React.useState([])
    React.useEffect(() => {
        let userDetails = localStorage.getItem("userDetails")
        let data = JSON.parse(userDetails)
        setUserDatas(data)
    }, [])
    return (
        <Box sx={{ flexGrow: 1 }} mt={5}>
            <Grid container spacing={{ xs: 0 }} columns={{ xs: 4, sm: 8, md: 12 }}>
                {userdatas.length > 0 ? userdatas?.map((data, index) => (

                    <Grid item xs={0} sm={4} md={4} key={index}>
                        <Item>
                            <Card sx={{ maxWidth: 345 }}>
                                <CardActionArea onClick={() => {
                                    viewAnswers(data)
                                }}>
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {data.name}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Category : {data.question_category}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Difficulty : {data.question_difficulty}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Score : {data.score}
                                        </Typography>
                                        <Typography textAlign={"left"} variant="body2" color="text.secondary">
                                            Percentage : {data.percentageValue}
                                        </Typography>
                                        <Typography sx={{ color: "blue" }} textAlign={"left"} variant="body2" color="text.secondary">
                                            Click to view answers
                                        </Typography>
                                    </CardContent>
                                </CardActionArea>
                            </Card>
                        </Item>
                    </Grid>
                )) :
                    <Typography textAlign={"center"} variant="h5" color="text.secondary">
                        NO USER FOUND
                    </Typography>
                }
            </Grid>
        </Box>
    );
}
